import { ChromeOutlined, DollarOutlined } from '@ant-design/icons';
import { PageContainer, ProLayout } from '@ant-design/pro-components';
import { useState } from 'react';
import { Link, Outlet, useModel,history } from 'umi';
export default () => {
    const [pathname, setPathname] = useState('/dashboard/styles');
    return <div
        style={{
            height: '100vh',
        }}
    >
        <ProLayout
            location={{
                pathname,
            }}
            title="ShowNOW"
            logo="data:image/png;base64,"
            route={{
                path: '/dashboard',
                routes: [
                    {
                        path: '/dashboard/styles',
                        name: 'Styles',
                        icon: <ChromeOutlined />,
                    },
                    {
                        path: '/dashboard/fees',
                        name: 'FeeRates',
                        icon: <DollarOutlined />,
                    },
                ],
            }}
            menuItemRender={(item, dom) => (
                <a
                    onClick={() => {
                        setPathname(item.path || '/dashboard/styles');
                        history.push(item.path || '/dashboard/styles');
                    }}
                >
                    {dom}
                </a>
            )}
        >
            <PageContainer >
                <Outlet />
            </PageContainer>
        </ProLayout>
    </div>
};